\u043f\\u0440\\u0438 \\u043e\\u0444\\u043e\\u0440\\u043c\\u043b\\u0435\\u043d\\u0438\\u0438 \\u0437\\u0430\\u043a\\u0430\\u0437\\u0430. \\u041f\\u043e\\u043a\\u0430\\u0437\\u0430\\u0442\\u044c \\u043b\\u0443\\u0447\\u0448\\u0438\\u0439 \\u0432\\u044b\\u0431\\u043e\\u0440 \\u043a\\u0443\\u0440\\u044c\\u0435\\u0440\\u043e\\u0432, \\u0432 \\u0434\\u043e\\u043f\\u043e\\u043b\\u043d\\u0435\\u043d\\u0438\\u0435 \\u043a \\u0441\\u0440\\u043e\\u043a\\u0430\\u043c \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0438 \\u0438 \\u043f\\u043e\\u043b\\u043d\\u043e\\u0439 \\u0441\\u0442\\u043e\\u0438\\u043c\\u043e\\u0441\\u0442\\u0438 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0438. \\u0423\\u0437\\u043d\\u0430\\u0439\\u0442\\u0435, \\u043a\\u0430\\u043a \\u043e\\u0444\\u043e\\u0440\\u043c\\u043b\\u0435\\u043d\\u0438\\u0435 \\u0437\\u0430\\u043a\\u0430\\u0437\\u0430 \\u0443\\u0432\\u0435\\u043b\\u0438\\u0447\\u0438\\u0432\\u0430\\u0435\\u0442 \\u043a\\u043e\\u043b\\u0438\\u0447\\u0435\\u0441\\u0442\\u0432\\u043e \\u043a\\u043e\\u043d\\u0432\\u0435\\u0440\\u0441\\u0438\\u0439. Cargo \\u043b\\u0435\\u0433\\u043a\\u043e \\u0438\\u043d\\u0442\\u0435\\u0433\\u0440\\u0438\\u0440\\u0443\\u0435\\u0442\\u0441\\u044f \\u0441 \\u0432\\u0435\\u0434\\u0443\\u0449\\u0438\\u043c\\u0438 \\u043f\\u043b\\u0430\\u0442\\u0444\\u043e\\u0440\\u043c\\u0430\\u043c\\u0438 \\u0438 \\u0442\\u043e\\u0440\\u0433\\u043e\\u0432\\u044b\\u043c\\u0438 \\u043f\\u043b\\u043e\\u0449\\u0430\\u0434\\u043a\\u0430\\u043c\\u0438 \\u044d\\u043b\\u0435\\u043a\\u0442\\u0440\\u043e\\u043d\\u043d\\u043e\\u0439 \\u043a\\u043e\\u043c\\u043c\\u0435\\u0440\\u0446\\u0438\\u0438. \\u0412\\u044b \\u043c\\u043e\\u0436\\u0435\\u0442\\u0435 \\u0443\\u043f\\u0440\\u0430\\u0432\\u043b\\u044f\\u0442\\u044c \\u0432\\u0441\\u0435\\u043c\\u0438 \\u0441\\u0432\\u043e\\u0438\\u043c\\u0438 \\u043e\\u0442\\u043f\\u0440\\u0430\\u0432\\u043b\\u0435\\u043d\\u0438\\u044f\\u043c\\u0438, \\u043d\\u0435 \\u043d\\u0430\\u043f\\u0438\\u0441\\