(20, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"image_place\":\"start\",\"section_title\":{\"en\":\"The Cheapest Shipping Rates, Guaranteed\",\"ar\":\"\\u0623\\u0631\\u062e\\u0635 \\u0623\\u0633\\u0639\\u0627\\u0631 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u0645\\u0636\\u0645\\u0648\\u0646\\u0629\"},\"section_description\":{\"en\":\"Stop overpaying for shipping. Our rates remain unbeaten and are available to everybody. See how you can save up to 89% on top couriers. With 250+ courier services from USPS, UPS, DHL and more, we have the right courier for your needs. See available couriers and shipping rates.\",\"ar\":\"\\u062a\\u0648\\u0642\\u0641 \\u0639\\u0646 \\u062f\\u0641\\u0639 \\u0645\\u0628\\u0627\\u0644\\u063a \\u0632\\u0627\\u0626\\u062f\\u0629 \\u0644\\u0644\\u0634\\u062d\\u0646. \\u0623\\u0633\\u0639\\u0627\\u0631\\u0646\\u0627 \\u0644\\u0627 \\u062a\\u0647\\u0632\\u0645 \\u0648\\u0645\\u062a\\u0627\\u062d\\u0629 \\u0644\\u0644\\u062c\\u0645\\u064a\\u0639. \\u062a\\u0639\\u0631\\u0641 \\u0639\\u0644\\u0649 \\u0643\\u064a\\u0641\\u064a\\u0629 \\u062a\\u0648\\u0641\\u064a\\u0631 \\u0645\\u0627 \\u064a\\u0635\\u0644 \\u0625\\u0644\\u0649 89\\u066a \\u0639\\u0644\\u0649 \\u0623\\u0641\\u0636\\u0644 \\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0646\\u0642\\u0644. \\u0645\\u0639 \\u0623\\u0643\\u062b\\u0631 \\u0645\\u0646 250 \\u062e\\u062f\\u0645\\u0629 \\u0628\\u0631\\u064a\\u062f \\u0633\\u0631\\u064a\\u0639 \\u0645\\u0646 USPS \\u0648 UPS \\u0648 DHL \\u0648\\u063a\\u064a\\u0631\\u0647\\u0627 \\u060c \\u0644\\u062f\\u064a\\u0646\\u0627 \\u0627\\u0644\\u0628\\u0631\\u064a\\u062f \\u0627\\u0644\\u0633\\u0631\\u064a\\u0639 \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628 \\u0644\\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a\\u0643. \\u0627\\u0646\\u0638\\u0631 \\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u0645\\u062a\\u0627\\u062d\\u0629 \\u0648\\u06