(22, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"image_place\":\"start\",\"section_title\":{\"en\":\"Improve Your Store. No Coding Necessary.\",\"ar\":\"\\u062a\\u062d\\u0633\\u064a\\u0646 \\u0634\\u0631\\u0643\\u062a\\u0643. \\u0644\\u0627 \\u062d\\u0627\\u062c\\u0629 \\u0644\\u0644\\u0628\\u0631\\u0645\\u062c\\u0629 \\u0628\\u0646\\u0641\\u0633\\u0643.\"},\"section_description\":{\"en\":\"Increase checkout conversion rates with dynamic rates at checkout. Show the best selection of couriers, in addition to delivery times and fully landed costs. Learn how checkout drives conversions. Cargo is seamlessly integrated with leading eCommerce platforms and marketplaces. You can manage all your shipments without writing a single line of code. See our integrated platforms.\",\"ar\":\"\\u0642\\u0645 \\u0628\\u0632\\u064a\\u0627\\u062f\\u0629 \\u0645\\u0639\\u062f\\u0644\\u0627\\u062a \\u062a\\u062d\\u0648\\u064a\\u0644 \\u0627\\u0644\\u0633\\u062f\\u0627\\u062f \\u0628\\u0645\\u0639\\u062f\\u0644\\u0627\\u062a \\u062f\\u064a\\u0646\\u0627\\u0645\\u064a\\u0643\\u064a\\u0629 \\u0639\\u0646\\u062f \\u0627\\u0644\\u0633\\u062f\\u0627\\u062f. \\u0639\\u0631\\u0636 \\u0623\\u0641\\u0636\\u0644 \\u0645\\u062c\\u0645\\u0648\\u0639\\u0629 \\u0645\\u0646 \\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0646\\u0642\\u0644 \\u060c \\u0628\\u0627\\u0644\\u0625\\u0636\\u0627\\u0641\\u0629 \\u0625\\u0644\\u0649 \\u0623\\u0648\\u0642\\u0627\\u062a \\u0627\\u0644\\u062a\\u0633\\u0644\\u064a\\u0645 \\u0648\\u062a\\u0643\\u0627\\u0644\\u064a\\u0641 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0628\\u0627\\u0644\\u0643\\u0627\\u0645\\u0644. \\u062a\\u0639\\u0631\\u0641 \\u0639\\u0644\\u0649 \\u0643\\u064a\\u0641\\u064a\\u0629 \\u062f\\u0641\\u0639 \\u0627\\u0644\\u062f\\u0641\\u0639 \\u0644\\u0644\\u062a\\u062d\\u0648\\u064a\\u0644\\u0627\\u062a. \\u062a\\u062a\\u0643\\u0627\\u0645\\u0644 Cargo \\u0628\\u0633\\u0644\\u0627\\u0633\\u0629 \\u0645\\u0639 \\u06