(24, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"image_place\":\"start\",\"section_title\":{\"en\":\"Access Our Network of Global Warehouses\",\"ar\":\"\\u0627\\u0644\\u0648\\u0635\\u0648\\u0644 \\u0625\\u0644\\u0649 \\u0634\\u0628\\u0643\\u062a\\u0646\\u0627 \\u0645\\u0646 \\u0627\\u0644\\u0645\\u0633\\u062a\\u0648\\u062f\\u0639\\u0627\\u062a \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645\\u064a\\u0629\"},\"section_description\":{\"en\":\"Improving transit times, lowering shipping costs, and reducing tariff exposure has never been easier than with our global network of 3PL partners. Our shipping consultants will tailor a fulfillment strategy perfect for your business. Learn more about our fulfillment network.\",\"ar\":\"\\u0644\\u0645 \\u064a\\u0643\\u0646 \\u062a\\u062d\\u0633\\u064a\\u0646 \\u0623\\u0648\\u0642\\u0627\\u062a \\u0627\\u0644\\u062a\\u0631\\u0627\\u0646\\u0632\\u064a\\u062a \\u060c \\u0648\\u062e\\u0641\\u0636 \\u062a\\u0643\\u0627\\u0644\\u064a\\u0641 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u060c \\u0648\\u062a\\u0642\\u0644\\u064a\\u0644 \\u0627\\u0644\\u062a\\u0639\\u0631\\u0636 \\u0644\\u0644\\u062a\\u0639\\u0631\\u064a\\u0641\\u0629 \\u0627\\u0644\\u062c\\u0645\\u0631\\u0643\\u064a\\u0629 \\u0623\\u0633\\u0647\\u0644 \\u0645\\u0646 \\u0623\\u064a \\u0648\\u0642\\u062a \\u0645\\u0636\\u0649 \\u0645\\u0639 \\u0634\\u0628\\u0643\\u062a\\u0646\\u0627 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645\\u064a\\u0629 \\u0645\\u0646 \\u0634\\u0631\\u0643\\u0627\\u0621 3PL. \\u0633\\u064a\\u0635\\u0645\\u0645 \\u0645\\u0633\\u062a\\u0634\\u0627\\u0631\\u0648 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0644\\u062f\\u064a\\u0646\\u0627 \\u0627\\u0633\\u062a\\u0631\\u0627\\u062a\\u064a\\u062c\\u064a\\u0629 \\u062a\\u0644\\u0628\\u064a\\u0629 \\u0645\\u062b\\u0627\\u0644\\u064a\\u0629 \\u0644\\u0639\\u0645\\u0644\\u0643. \\u062a\\u0639\\u0631\\u0641 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0632\\u064a\\u062f \\u062d\\u0648\\u0644 \